dialog.text:
Uhhh. So since he can't possibly be one of the admirals... Oh, it must be that dude, right?

The guy that, like Momousagi, was nominated to be an admiral; this (→) guy, Vice Admiral "Chaton", right?!
You're right, you're right, I found him in my sketchbook. There actually was a time at one point where I considered making the new admirals a "Pig" and "Kappa" to match the "Monkey" "Pig" and "Kappa" trio from ''[[wikipedia:Journey to the West|Journey to the West]]''. However, in the end, I decided against it and we're here now with our newest additions, the "Tiger" and the "Bull". There ''is'' an actual reason for this, but I won't tell. {{-}}

Ouch... So someone actually went and did it...!! I understand, those feelings of longing and admiration to be like Senor.

So you're currently 13 years old. I would advise you to experience life for, say, around 30 more years, until you start reeking of ''coolness''. I promise to develop Senor's character and good side to guide you in your journey!

Also, I wouldn't go in the direction of your pen name. Just don't end up on the wrong side!{{-}}
